import React from 'react';

const Card = (data) => (
    <div className='card'>
        <div className='card__picture'>
            <img src={`../../server/files/${data.img}`} alt={data.name}/>
            { 
                fetch(`http://localhost:5000/api/goods/img?img=${data.name}`)
                  .then((response) => {
                      return response.img()
                  })
                  
             }
        </div>
        <p className='card__text'>{data.name}</p>
        <p className='card__text'>{data.cost}</p>
    </div>
)

export default Card;
